import React, { useEffect } from "react";
import { useNavigate } from "react-router-dom";

const Protectedroute = (props) => {
  let navigate = useNavigate();

  useEffect(() => {
    let Authtoken = localStorage.getItem("Auth key");
    if (Authtoken) {
      navigate("/home");
    }
    if (!Authtoken) {
      navigate("/login");
    }
  }, []);
  let Comp = props.cmp;
  return (
    <div>
      <Comp />
    </div>
  );
};

export default Protectedroute;
